    [],nt"num_tags": 5,nt"name": "critical-habitat-recommendations-for-the-aleutian-canada-goose",nt"isopen":
    false,nt"url": null,nt"notes": "The following recommendations concern the
    designation of critical habitat on Federal lands in Alaska for the Endangered Species,
    Aleutian Canada goose (Branta canadensis leucopareia). The Aleutian Canada goose
    once bred from the eastern Aleutian Islands to the Kuril Islands, and was abundant
    in the western Aleutians. Today the only known breeding population occurs on tiny
    Buldir Island in the western Aleutians. The present range and abundance, suspected
    reasons for decline, and recovery objectives are presented in this paper.",nt"owner_org":
